import React, { Component } from 'react';
import VideoAssets from '../assets/Data/videos.json';

export class Videos extends Component {


    render() {
        return (
            <div className='video'>
                <div className='video__player'>
                    <video width="100%" height='auto' backgroundImage={VideoAssets[0].image} controls>
                        <source src={VideoAssets[0].image} type='img'></source>
                    </video>
                            <img className='video__player--img' src={VideoAssets[0].image} alt='main video' />
                        </div>
                
            </div>
        )
    }
}

export default Videos;
